import React from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import { Dashboard } from "./MainPage/Dashboard/Dashboard";
import { AddEditBook } from "./AddEditBook/AddEdit";

function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/" component={Dashboard} />
        <Route path="/add-edit-book" component={AddEditBook} />
      </Router>
    </div>
  );
}

export default App;
